_lastPrice__activityLink link link_lightBlue'>Market Activity<\/a>).","footer.copyrights":"HIT Solution Inc. All Rights Reserved.","footer.about_us":"About Us","footer.forum":"Forum","footer.blog":"Blog","footer.legal":"Legal","footer.changelog":"Changelog","footer.support_center":"Support Center","footer.fees_and_limits":"Fees and Limits","footer.bug_report":"Bug Report","footer.add_token":"Add Token","footer.api":"API","footer.fix":"FIX","footer.price_widget":"Price Widget","footer.desktop_version":"Desktop Version","footer.otc_trading":"OTC Trading","footer.gdpr":"GDPR","footer.pro_account":"Pro Account","footer.twitter":"Twitter","footer.facebook":"Facebook","footer.telegram":"Telegram","footer.github":"Github","footer.reddit":"Reddit","footer.for_market":"For Market Makers","footer.system_health":"System Monitor","footer.coinmarketcap":"CoinMarketCap","webVersionNumber":"2.149.0","footer.status_label":"Status","footer.Connected":"Connected","footer.Disconnect":"Not connected","system_health.cryptocurrency":"Cryptocurrency","system_health.to_main":"To main","system_health.to_trading":"To trading","system_health.online":"Online","system_health.offline":"Offline","system_health.trading":"Trading","chat.long_msg_error":"Your message exceeds the limit of 320 symbols","add_token":"Add Token","privacy_policy_confirmation.title":"Privacy policy","privacy_policy_confirmation.confirm":"Confirm","privacy_policy_confirmation.last_update":"Last update","privacy_policy_confirmation.age_confirmation_label":"By checking this box you warrant and confirm that you are at least 18 years old or of a legal age of your country, when it is higher, and that you are entitled to act on your own including entering into agreements and giving consents to the use of your Personal Information without necessity to obtain parental consent.","privacy_policy_confirmation.data_sync_confirmation_label":"By checking this box you voluntarily and expressly agree to our collection, control, process and use of your Personal Information in accordance with our Privacy Policy and for the purposes stated herein. If you provide Personal Information to us, you acknowledge and agree that such personal data may be transferred from your current location to the servers of %site_domain% and to the servers of authorized third parties which are subject to the same terms and conditions as set up in this Policy. You have the right to withdraw your consent at any time.","privacy_policy_confirmation.email_subscription_label":"By checking this box you acknowledge and agree that you will be included into our mailing database, subscribed to our newsletters and may receive some information from time to time that we may wish to share with you. You have the right to withdraw your subscription at any time.","privacy_policy_confirmation.description":"Submission description","privacy_policy_confirmation.text":"<h1 dir=\"ltr\">Privacy Policy<\/h1>\n                    <blockquote>To provide You with Our services We need (and sometimes are obliged by the law) to collect Your personal data. This Privacy Policy (the \"Policy\") informs Users (a \"User\", \"You\") of our policies regarding the processing of Personal Information we receive from Users of the\u00a0<a href=\"https:\/\/hitbtc.com\">hitbtc.com<\/a>\u00a0(the \"Technology Platform\", \"Us\", \"We\", or \"Our\"). The Policy applies to the Technology Platform and all services offered by HitBTC.<\/blockquote>\n                    <br>\n                    <p>The Personal Information on the Technology Platform is collected, controlled and processed by the following entities:<\/p>\n                    <p>Hit Solution Limited<br>\n                    Data Protection Office<br>\n                    Unit 19, 7\/F., One Midtown No.11 Hoi Shing Road,\u00a0<br>\n                    Tsuen Wan, New Territories, Hong Kong\u00a0<br>\n                    E-mail: <a href=\"mailto:dpo@hitbtc.com\">dpo@hitbtc.com<\/a><\/p>\n                    <p>AND (for EU)<\/p>\n                    <p>\n                    Bequant Exchange Limited<br>\n                    5B, Office 2, Spinola Residence, Spinola Road,<br>\n                    St. Julians. STJ 3012, Malta<br>\n                    E-mail: <a href=\"mailto:compliance@bequant.io\">compliance@bequant.io<\/a><\/p>\n                    <br>\n                    <h3 dir=\"ltr\">1. What Kind of Personal Information We Collect<\/h3>\n                    <p>1.1. While providing Our services We may collect the \"Personal Information\" which is defined as any information that identifies or can be used to identify, contact, or locate the person to whom such information pertains. Namely, we may collect:<\/p>\n                    <p>1.1.1. Identity information: name, facial image, social security number, ID number, documents proving your identity and any other information they may contain;<\/p>\n                    <p>1.1.2. Residential information: IP address, residence address, documents proving your residency and any other information they may contain;<\/p>\n                    <p>1.1.3. Contact information: email address, mailing address, phone number;<\/p>\n                    <p>1.1.4. Security information: alias, passwords;<\/p>\n                    <p>1.1.5. Financial and billing information: number of bank accounts and names of banking institutions, identifiers in payment systems or other means of payment, information on your balance accounts, your trade history, incoming and outgoing wallet addresses;<\/p>\n                    <p>1.1.6. Cookies: to know more about cookies please acquaint yourself with Our\u00a0<a href=\"https:\/\/hitbtc.com\/cookie-policy\">Cookie Policy<\/a>;<\/p>\n                    <p>1.1.6. Your mobile devices You use with the Technology Platform may provide some information that may potentially identify You, such as the type (including identifiers) of the device, platform type, mobile phone number, Your internet service, operating system, geolocation information, browser You use, browser language, or the pages You visit, etc.;<\/p>\n                    <p>1.1.7. The Technology Platform may collect some of Your behavior information, such as Your visiting the Technology Platform, clicking on ads or other similar information. Such information may be received with additional related data (or metadata), such as the time, date, and location related to such information;<\/p>\n                    <p>1.1.8. Sometimes you decide to share with us some other Personal Information and we may collect it as well.<\/p>\n                    <p>1.2. We do not collect any information that may identify You without your permission. However, We use Google Analytics on Our Technology Platform. If You want to know more about Google Analytics and its \"do not track\" policy, please visit <a href=\"https:\/\/www.google.com\/analytics\/terms\/us.html\">https:\/\/www.google.com\/analytics\/terms\/us.html<\/a><\/p>\n                    <br>\n                    <h3 dir=\"ltr\">2. How We Use Your Personal Information<\/h3>\n                    <p>2.1. We, our authorized partners and our representatives store and use Your Personal Information only for providing and improving the Technology Platform. In particular, we use Users' Personal Information for the following purposes:<\/p>\n                    <p>2.1.1. To provide you the Services: We may use information to execute your transaction requests and trade orders;<\/p>\n                    <p>2.1.2. To comply with the our legal obligations: In many jurisdictions we are obliged to collect certain information about our Users to be authorized to act (Know Your Client and Anti-Money Laundering regulations);<\/p>\n                    <p>2.1.3. To protect your assets: We may use information to identify you and the assets belonging to you in order to secure access to your accounts and to prevent the fraud;<\/p>\n                    <p>2.1.4. To improve customer service: information provided by Users helps Us respond to customer service requests and support needs more efficiently;<\/p>\n                    <p>2.1.5. To personalize User experience: We may use information in a general manner to understand how Our Users as a group use the services and resources provided on Our Technology Platform;<\/p>\n                    <p>2.1.6. To improve Our Technology Platform: We may use the feedback provided by Users to improve Our products and services;<\/p>\n                    <p>2.1.7. To maintain Our Technology Platform: We may use the information Users provide about themselves when receiving transaction request only to provide service to that request;<\/p>\n                    <p>2.1.8. To send periodic emails: We may use the email address to send information and updates pertaining to Your use of the transaction request;<\/p>\n                    <p>2.1.9. To resolve disputes and enforce our agreements to the extent necessary and sufficient for protecting your interests or interests of other Users.<\/p>\n                    <p>2.2. We strictly follow industry best practices in the industry and adhere to the rules set forth in GDPR, OPPA, CAN-SPAM and COPPA.<\/p>\n                    <br>\n                    <h3 dir=\"ltr\">3. How We Can Share the Information<\/h3>\n                    <p>3.1. In certain situations, We may be required to disclose personal data in response to lawful requests by competent authorities, including to meet national security, public interests or law enforcement requirements. Our policies regarding exchange of information with competent authorities is reflected in Our\u00a0<a href=\"https:\/\/hitbtc.com\/transparency\">Transparency Policy<\/a>.<\/p>\n                    <p>3.2. We may disclose your Personal Information where required by law (e.g., to comply with a subpoena, warrant, court order, or legal process served on HitBTC), and when we believe that disclosure is necessary to protect our rights, avoid litigation, protect your safety or the safety of others, investigate fraud, and\/or respond to a government request.<\/p>\n                    <p>3.3. We share Personal Information with certain companies that perform services on our behalf on a need-to-know basis. We require any company with which we may share Personal Information to protect that data in a manner consistent with this policy and to limit the use of such Personal Information to the performance of services for HitBTC. You may find a <a href=\"https:\/\/hitbtc.com\/partners\">list of these third-party sub-processors<\/a>.<\/p>\n                    <p>3.4. You agree that We may share and transfer Your information which no longer identifies You to the third party (pseudonymisation) who is a contracting party with Us, usually Our service providers or advertising partners.<\/p>\n                    <br>\n                    <h3 dir=\"ltr\">4. For How Long We Retain Your Personal Information<\/h3>\n                    <p>4.1. We will retain your information for as long as your account is active, your information is needed to provide you services, or as required to fulfill our legal obligations.<\/p>\n                    <p>4.2. By contacting us at (write a contact e-mail) you can at any time obtain the confirmation whether or not the personal data concerning you is being processed.<\/p>\n                    <br>\n                    <h3 dir=\"ltr\">5. How We Protect Your Information<\/h3>\n                    <p>5.1. We adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of Your personal information, username, password, transaction information and data stored on Our Technology Platform.<\/p>\n                    <p>5.2. Sensitive and private data exchange between the Technology Platform and its Users happens over an SSL-secured communication channel and is encrypted and protected with digital signatures. Our Technology Platform is functioning in compliance with PCI vulnerability standards in order to create an environment as secure as possible for Users.<\/p>\n                    <p>5.3. Unfortunately, there is no such thing as completely secure data transmission or storage, so We cannot guarantee that Our security will not be breached (by technical measures or through violation of Our policies and procedures).<\/p>\n                    <p>5.4. Without prejudice to Our efforts on protection of Your information nothing herein constitute a warranty of security of the Technology Platform, and You agree to transmit information at Your own risk. Please note, that the Technology Platform does not guarantee that Your information may not be accessed, disclosed, altered, or destroyed by breach of any of Our physical, technical, or managerial safeguards.<\/p>\n                    <br>\n                    <h3 dir=\"ltr\">6. What Are Your Rights to Your Data <\/h3>\n                    <p>6.1. All Your Personal Information we collect will always belong to you. However, we are a collector and a processor of Your Personal Information. That implies on us obligations to respect your rights to Personal Information and facilitate the exercise of your rights thereto. In order to use any of Your rights at any time please contact us and we will facilitate the exercise of your rights free of charge. We will inform You on the actions taken by Us under Your request as soon as practically possible, but in any case not later than in 30 (thirty) calendar days.<\/p>\n                    <p>6.2. In accordance with effective regulations You have a significant number of rights related to your Personal Information, such as e.g.: <\/p>\n                    <p>6.2.1. Right to access. You may obtain from Us the confirmation as to whether or not personal data concerning You is being processed and get an access to such personal data;<\/p>\n                    <p>6.2.2. Right to rectify Your inaccurate Personal Information and to have incomplete personal data completed, including by means of providing a supplementary statement<\/p>\n                    <p>6.2.3. Right to erase your Personal Information. Please note that a request to erase your Personal Information will also terminate your account on the Site. We will automatically and without undue delay erase your Personal Information when it is no longer necessary in relation to the purposes for which it was collected or otherwise processed; <\/p>\n                    <p>6.2.4. Right to restrict processing of your Personal Information; <\/p>\n                    <p>6.2.5. Right to data portability. You may obtain from Us the personal data concerning You and which You have provided to us and transmit it to another Personal Information Controller;<\/p>\n                    <p>6.2.6. Right to object to processing of Your Personal Information, <\/p>\n                    <p>6.2.7. Right to withdraw your consent to the usage of your Personal Information at any time<\/p>\n                    <p>6.2.8. Right to lodge a complaint. We take privacy concerns seriously. If you believe that we have not complied with this Privacy Policy with respect to your Personal Information, you may contact our respective Data Protection Office. We will investigate your complaint promptly and will reply you within 30 (thirty) calendar days. If you do not receive acknowledgment of your complaint or your complaint is not satisfactorily addressed, you have the right to lodge a complaint with the respective supervisory authority:<\/p>\n                    <br>\n                    <p>Office of the Privacy Commissioner for Personal Data<br>\n                    <a href=\"https:\/\/www.pcpd.org.hk\/english\/complaints\/how_complaint\/complaint\/complaint.html\">https:\/\/www.pcpd.org.hk\/english\/complaints\/how_complaint\/complaint\/complaint.html<\/a> <br>\n                    <br>\n                    or (for EU) Information Commissioner's Office<br>\n                    <a href=\"https:\/\/ico.org.uk\/make-a-complaint\/\">https:\/\/ico.org.uk\/make-a-complaint\/<\/a>.<\/p>\n                    <br>\n                    <h3 dir=\"ltr\">7. Children<\/h3>\n                    <p>7.1. We do not intend to solicit or collect Personal Information from anyone under the age of 18 or under the legal age of your country, if it is higher. If you are under 18 or are not of a legal age of your country, do not enter any personal information on our Technology Platform.<\/p>\n                    <br>\n                    <h3 dir=\"ltr\">8. Changes to the Privacy Policy<\/h3>\n                    <p>8.1. The Technology Platform has the discretion to update this Policy at any time. User should check this Privacy Policy periodically. Your continued use of the service after We post any modifications to the Privacy Policy on this page will constitute Your acknowledgment of the modifications and Your consent to abide and be bound by the modified Privacy Policy.<\/p>\n                    <p>8.2. If We make any material changes to this Privacy Policy, We will notify You either through the email address You have provided Us, or by placing a prominent notice on the Technology Platform. You acknowledge and agree that it is Your responsibility to review this privacy policy periodically and become aware of modifications.<\/p>\n                    <br>\n                    <h3 dir=\"ltr\">9. Contacting Us<\/h3>\n                    <p>9.1. If You have any questions about this Privacy Policy, wish to exercise any of Your rights to your Personal Information or file a complaint, please contact Us at:<br>\n                    Hit Solution Limited<br>\n                    Data Protection Office<br>\n                    Unit 19, 7\/F., One Midtown No.11 Hoi Shing Road,<br>\n                    Tsuen Wan, New Territories, Hong Kong\u00a0<br>\n                    E-mail: <a href=\"mailto:dpo@hitbtc.com\">dpo@hitbtc.com<\/a><\/p>","privacy_policy_confirmation.updated_at":"2018-10-23","default_mode":"Day mode","withdraw_request.text":"<div>\n    <div>Dear Trader,<\/div>\n    <div>\u00a0<\/div>\n    <div>You requested to withdraw {amount} {currency} to the following address: <br>\n        {address}.<br>\n        Please confirm this action by clicking <a href=\"{link}\" target=\"_blank\">this link<\/a>.\n    <\/div>\n    <br>\n\t<div style=\"word-break: break-word; word-wrap: break-word; overflow-wrap: break-word; opacity: 0.6;\">\n\tYou can also copy the link and paste it in your browser: <br>\n\t{link}\n\t<\/div>\n\t<br>\n    <div>Your request for withdrawal will expire in 1 hour.<\/div>\n    <br>\n<div>If you haven't requested it, please contact our <a href=\"https:\/\/support.hitbtc.com\/hc\/en-us\/requests\/new?ticket_form_id=360000029605\" target=\"_blank\">support team<\/a>.<\/div><br>\n    Best regards,<br>\n    HitBTC Team\n<\/div>","mail_template.footer_text":"<div style=\"font-size:14px; color:#888888; font-weight:normal; text-align:center; font-family:Arial,Helvetica,sans-serif;\">\n  <div>\n      This email was sent to {mail}\n      <div>You received this email because you are registered with HitBTC<\/div>\n      <div>\u00a0\n        <a href=\"https:\/\/support.hitbtc.com\" target=\"_blank\" style=\"text-decoration: underline; color: rgb(102, 102, 102);\">Support<\/a>\n      <\/div>\n  <\/div>\n<\/div>","change_password.text":"<div>\n\t<div>Dear Trader,<\/div>\n\t<br>\n\t<div>\n\tThe password of your HitBTC account {email} has been changed.<br\/>\n\tIf you would like to reset your password again, please use <a href=\"{link}\" target=\"_blank\">this \tlink<\/a>.\n\t<\/div>\n\t<br>\n\t<div style=\"word-break: break-word; word-wrap: break-word; overflow-wrap: break-word; opacity: 0.6;\">\n\tYou can also copy the link and paste it in your browser: <br>\n\t{link}\n\t<\/div>\n\t<br>\n<div>If you didn't change your password, please <a href=\"https:\/\/support.hitbtc.com\/hc\/en-us\/requests\/new?ticket_form_id=360000029605\">notify us<\/> as soon as possible.<\/div><br>\n    <div>Best regards,<br>\n    HitBTC Team<\/div>\n<\/div>","confirm_add_whitelist.text":"<div>\n    <div>Dear Trader,<\/div>\n    <br>\n\t<div>\n\tYou are about to add a trusted {currency} address to the whitelist. Please note that once you click the link below, for the sake of security all withdrawals on your account will be suspended for 48 hours.<br>\n\tTo proceed, click <a href=\"{link}\" target=\"_blank\">this link<\/a>.\n\t<\/div>\n\t<br>\n\t<div style=\"word-break: break-word; word-wrap: break-word; overflow-wrap: break-word; opacity: 0.6;\">\n\tYou can also copy the link and paste it in your browser: <br>\n\t{link}\n\t<\/div>\n\t<br>\n    <div>This link will expire in 10 minutes.<\/div>\n    <br>\n<div>If you haven't requested it, please contact our <a href=\"https:\/\/support.hitbtc.com\/hc\/en-us\/requests\/new?ticket_form_id=360000029605\" target=\"_blank\">support team<\/a>.<\/div><br>\n    <div>Best regards,<br>\n    HitBTC Team<\/div>\n<\/div>","confirm_delete_whitelist.text":"<div>\n    <div>Dear Trader,<\/div>\n    <br>\n\t<div>\n\tYou are trying to remove one of the withdrawal addresses from your Whitelist. In order to proceed, click <a href=\"{link}\" target=\"_blank\">this link<\/a>.\n\t<\/div>\n\t<br>\n\t<div style=\"word-break: break-word; word-wrap: break-word; overflow-wrap: break-word; opacity: 0.6;\">\n\tYou can also copy the link and paste it in your browser: <br>\n\t{link}\n\t<\/div>\n\t<br>\n    <div>This link will expire in 10 minutes.<\/div>\n    <br>\n    <div>Best regards,<br>\n    HitBTC Team<\/div>\n<\/div>","confirm_disable_whitelist.text":"<div>\n    <div>Dear Trader,<\/div>\n    <br>\n\t<div>\n\tYou are about to disable the Whitelist. Please note that the Whitelist feature is designed to provide greater security for your funds. By removing the Whitelist, you confirm that any addresses become authorized for withdrawals from your account.<br>\n<b>Attention:<\/b> This ac