:\/\/account.bequant.io\/account\/unlimited\/?uuid={token}","verification.business_kyc_link":"https:\/\/account.bequant.io\/account\/business\/?uuid={token}","fix_api.fix_api":"FIX API","fix_api.what_is.header":"What is FIX API?","fix_api.what_is.description.first":"FIX (Financial Information Exchange) is an internationally recognized electronic trading protocol designed specifically for transferring substantial amounts of financial information among market participants in real time. FIX has established a reputation as the most efficient protocol for performing all types of financial operations across all asset classes.","fix_api.what_is.description.second":"HitBTC's FIX API, based on <a href='\/fix-spec' target='_blank' rel='noopener noreferrer'>FIX protocol 4.4<\/a> is a fast, stable, and secure way to connect to the exchange platform, receive market information and place orders using your own trading software.","fix_api.advantages.header":"Advantages of&nbsp;HitBTC's&nbsp;FIX&nbsp;API","fix_api.advantages.description":"Integrate any custom platform into the secure environment of the most advanced crypto exchage since 2013.","fix_api.advantages.list.item.first.header":"Minimal latency","fix_api.advantages.list.item.second.header":"Highly secure","fix_api.advantages.list.item.third.header":"Full access","fix_api.advantages.list.item.first.description":"and instant connectivity 24\/7","fix_api.advantages.list.item.second.description":"and safe","fix_api.advantages.list.item.third.description":"to the HitBTC instruments and&nbsp;liquidity","fix_api.benefits.list.header":"Who will benefit <br \/> from HitBTC's FIX API","fix_api.benefits.list.item.first":"Institutional partners\/investors","fix_api.benefits.list.item.second":"Brokers and corporations","fix_api.benefits.list.item.third":"Private traders","fix_api.benefits.list.item.fourth":"Hedge funds and asset managers","fix_api.benefits.list.item.fifth":"Research companies","fix_api.benefits.list.item.sixth":"Rating 