.back":"Back to all contests","single_contest.table_title":"Leaderboard","single_contest.note_title":"Important note","single_contest.note_text":"<div style=\"line-height: 1.3;\"><p>HitBTC provides the Contest Organizer with a Technology Platform to conduct the Trading Contest only. HitBTC is not affiliated with the Contest Organizer; the Trading Contest does not create and shall not be deemed as creating any joint venture or agent agreement. This Trading Contest is organized, arranged and held on by the Contest Organizer and under its responsibility.\u00a0<\/p>\n<p>HitBTC shall have no responsibility for conducting and holding the Trading Contest, including without limitation the terms, reward distribution rules or any other aspect of the Trading Contest. <\/p>\n<p>HitBTC does not choose the winner of the Trading Contest. HitBTC functions solely as a Technology Platform that distributes the prize pool among the winners of the Trading Contest according to instructions given by the Contest Organizer.\u00a0<\/p>\n<p>The Contest Organizer, its subsidiaries and any other affiliates are strictly prohibited to take part in Trading Contest. They shall not receive any part of the prize pool. If such case occurred, HitBTC reserves the right to exclude such users from the further participation in the Trading Contest.\u00a0<\/p>\n<p>HitBTC reserves the right to ban Users from further participation in Trading Contest in case any trade of the User is deemed as \"wash trade\" or any other illegal activity has been detected.<\/p>\n<p>User and Contest Organizer agree that HitBTC is not responsible for determining whether taxes or any other charges apply to participation in the Trading Contest. HitBTC shall neither act as tax agent of the User or Contest Organizer. <\/p>\n<p>User shall understand and acknowledge that participation in Trading Contest, and interactions with Contest Organizer, are at own risk of the User. By taking part in the Trading Contest Users allow HitBTC to process and\/or disclose their personal data to third parties according to HitBTC Privacy Policy.<\/p><\/div>","create_order.post_only_check":"Post only","create_order.post_only_hint_text":"A post-only limit order is either placed in the order book or expires if matches an existing order. Post-only option guarantees that you will not pay the taker fee.","gdpr.what_is_gdpr":"What is GDPR","gdpr.personal_information":"Personal Information","gdpr.secure_storage":"Secure Storage","gdpr.suspicious_activity":"Suspicious Activity","gdpr.remove_your_data":"Remove your data","gdpr.your_browser_doesnt_support_svg":"Your browser doesn't support svg images","gdpr.introducing":"Introducing HitBTC\u2019s <br\/> Privacy Policy updates","gdpr.received_many_questions":"Private data protection is a significant aspect of any digital business that increases the level of trust between a user and a company. The security of your trading, transparency in all operations and the privacy of your data are HitBTC's top priorities. To clarify, we've put together a brief explanation of how HitBTC stores and processes your data.","gdpr.general_data_protection_regulation_came":"The General Data Protection Regulation (GDPR) came into force on May 25, 2018.","gdpr.was_created_with_intention":"The GDPR was created with an intention of protecting the rights of individuals and giving them more control over their personal information.","gdpr.gdpr_regulates":"The GDPR regulates the ways businesses and public sector companies collect, manage and store their customers\u2019 data.","gdpr.what_is_personal_information":"What Is Personal Information","gdpr.personal_data_is_defined":"Your personal data is defined as any information that can be used to identify a person.","gdpr.alias":"Alias","gdpr.passwords":"Passwords","gdpr.platform_type":"Platform type","gdpr.phone_number":"Phone number","gdpr.etc":"etc.","gdpr.name":"Name","gdpr.facial_image":"Facial image","gdpr.id_number":"ID number","gdpr.ip_address":"IP addr