y and accountability. All material actions, transactions, non-operational decisions and changes to any of the statements or public commitments that affect the performance of HitBTC as EOS BP will be entirely public and will be communicated to the community in a timely and accurate manner without any undisclosed commitments, ambiguities or alterations. All operational processes will be entirely transparent and fully compliant with our values, as evinced in our Code of Conduct.","bp.code_of_conduct":"Code of Conduct","bp.ownership":"Ownership Disclosure","bp.code.title":"Code of Conduct","bp.code.communication_title":"Communication and Openness","bp.code.communication":"As an exchange operator, we have learned how important support and sharing are for our clients. Likewise, as a BP we will maintain an efficient communication channel between the EOS community and ourselves. Thereby, we will hold frequent discussions between our technical team and the community in an understanding manner for all. For us, this communication will be vital in order to better understand the community\u2019s needs and deliver value accordingly, all while gaining the most valuable asset \u2013  trust through transparency.","bp.code.constitiution_title":"Constitution and Arbitration","bp.code.constitiution":"The EOS Constitution is the document paving the way for any and all of our actions. We commit to upholding the rules set therein and their amendments under all circumstances, to the best of our knowledge, expertise, and without delay.\nThe decisions and conclusions reached by the EOS community-elected Arbitrators will always be respected and upheld, notwithstanding the subject matter and our own personal views of the issues in question. Public statements will invariably be made in any case we disagree in regards to the decisions made by the Arbitrators.","bp.code.novote_title":"No Vote Purchasing, Transparency, Efficient RAM Market","bp.code.novote":"It is our company belief that vote buying, and any similar action that attempts to solicit voters, is poisonous for any decentralized system in that it benefits only a few at the expense of the community. Such practice can only be considered an attempt to destroy the very purpose and foundation of the EOS ecosystem. In accordance with this belief, we shall never provide incentive of any kind - monetary or other - to obtain votes directly for a fee, or solicit EOS Proxies in assisting us to do so. All transactions that we make will be done in a fully transparent manner and specified in an understandable fashion. As noted, transparency is one of our guiding principles and, as such, we shall not structure our operations in a way that might allow for any type of activity to be endeavored against the transaction(s) validation process, regardless of the nature of the transaction.\\n\nSimilar to the transaction validation process, we view the market for RAM as one that is equally essential for the workings and growth of the EOS ecosystem. Therefore, we will always do our utmost to protect RAM price discovery, and will never take any actions to disrupt this fundamental part of the system process.","bp.code.independent_title":"Entirely Independent and Against Collusion","bp.code.independent":"Wherever one finds a market in which a few companies have colluded to form a cartel, one will most likely also discover stagnation. These companies will inevitably form a monopoly to extract super profits and create a deadweight loss for society. In the case of EOS, its community would be greatly affected. According to this line of reasoning, HitBTC will strive to fully prevent rent-seeking or collusive behavior with other BPs, in an attempt to preclude the accruing of benefits by only a select few, as opposed to the entire community. On the contrary, we will constantly seek to enhance the system through the sharing of knowledge and experience in a collaborative manner with the rest of the BPs.\nThroughout history, a lack of independence and a lack of bias caused by conflicts of interest have proven devastating for many businesses and even industries. In light of this, we commit to remaining fully independent, with no direct or indirect holdings or relations - operational or financial - with other block producers. Keeping in mind the efficient growth of the ecosystem, we will apply this virtue not only to the EOS blockchain, but to all other chains built around EOSIO, and never on more than a single node.","bp.code.performance_title":"Performance and Security","bp.code.performance":"Last but not least, we will employ our technical expertise in high-load, low-latency, and secure systems to ensure the uninterrupted performance of the BP. We deem continuous improvement through optimization of both the software and hardware sides crucial. We believe that this approach, accompanied by the channeling of BP rewards towards the enhancement of the quality of human capital, will contribute to building a versatile system capable of scaling in accordance with the demands of the EOS ecosystem. Security checks from independent auditors will be carried out on a regular basis, which, along with our experience as an exchange, are proven to add an integral layer of reliability and safety to any high-value system.","bp.code.back":"< Back","bp.ownership.title":"The Ownership Disclosure","bp.ownership.text":"It is our belief that the framework of the crypto space is built upon the integrity and fairness of the individuals and corporations involved in it. Given the widespread proliferation of both physical and cyber threats and attacks in the industry, we also fully understand that the safety and privacy of those individuals and companies alike are of critical importance.<br><br>\nEver since our inception in 2013, we have been among the top exchanges in terms of trading activity, all while maintaining a standard of security well above the industry level as indicated by our track record. Being such a widely-used exchange, the scale and reach of our operations are significantly wider than that of a typical block producer. While we feel compelled to reveal and disclose publicly the identities of our shareholders, we also realize and stress the fact that safety is key to ensuring the uninterrupted, efficient, and steady performance of both entities. Therefore, we ask the EOS community as well as our own to understand our position in maintaining the anonymity of our shareholders. <br><br>\nTo demonstrate our ability to effectively operate as a BP, all internal engineering enhancements and developments will be made available to the EOS community. It is our belief that being transparent with our technical knowledge, experience, and expertise will testify to our capabilities. This knowledge forms the bedrock upon which our continuing operations as a cryptocurrency trading venue are built. It is these principles that will account for our preparedness to carry out, efficiently and effectively, the EOS block producer activities in a technologically sound fashion. Finally, the utilization of all block producer rewards will be fully transparent and prudent, so as to ensure the auditability of our adherence to the EOS Constitution and the community.","bp.ownership.back":"< Back","bp.socials.community":"Community","bp.socials.twitter":"https:\/\/twitter.com\/hitbtc","bp.socials.facebook":"https:\/\/www.facebook.com\/hitbtc","bp.socials.github":"https:\/\/github.com\/hitbtc-com\/hitbtc-api","bp.socials.reddit":"https:\/\/www.reddit.com\/r\/en_hitbtc\/","bp.socials.mail":"mailto:relations@hitbtc.com","bp.socials.telegram":"https:\/\/t.me\/EN_HitBTC","account_status.starter":"Starter","account_status.trader":"Trader","account_status.pro":"Pro","pro_application.message":"Message","pro_application.send":"Submit","pro_application.text":"To access\n<ul>\n  <li>Personalized withdrawal limits<\/li>\n  <li>Negotiable fees<\/li>\n  <li>Higher API limits<\/li>\n  <li>Dedicated account manager<\/li>\n<\/ul>please leave contacts for video call and preferred timeslots below","settings.account_verification.withdrawal_limits":"Your current withdrawal limit is","settings.account_verification.starter_upgrading_to_trader":"To access withdrawal limit of","settings.account_verification.starter_complete_kyc":"Get verified","settings.account_verification.starter_low_limit":"<li><b>1<\/b> BTC daily<\/li><li><b>5<\/b> BTC monthly<\/li>","settings.account_verification.starter_none_limit":"<li><b>0<\/b> BTC daily<\/li>","settings.account_verification.trader_limit":"<li><b>100 BTC<\/b> daily<\/li><li><b>Unlimited<\/b> monthly<\/li>","settings.account_verification.upgrading_to_trader":"Upgrading to Trader account status","settings.account_verification.upgrading_to_pro":"Upgrading to PRO account status","settings.account_verification.starter_disclaimer":"Please note that in order to protect our customers we are implementing the best industry practices. We deploy comprehensive automated market surveillance, AML, and fraudulent activity prevention systems. Under those practices a customer may be asked to provide additional information regardless of their verification status.","settings.account_verification.starter_low_information":"<p>Dear customer, please note that in order to use the platform, i.e. deposit, withdraw and trade, you are required to be verified through our kyc procedure.<\/p>\n<p>After the verification is finished you will be granted with the equivalent of <b>100<\/b> BTC daily and <b>unlimited<\/b> monthly withdrawals.<\/p>\n<p>If you are a professional trader or institution and you require higher limits, please complete the PRO verification level.<\/p>","account.deposit.your_level_is_low":"You current account status (Starter) is insufficient for this functionality.","account.deposit.please_proceed_to_account":"<p>Dear customer, please note that in order to use the platform, i.e. deposit, withdraw and trade, you are required to be verified through our kyc procedure.<\/p>\n<p>After the verification is finished you will be granted\n with the equivalent of <b>100<\/b> BTC daily and <b>unlimited<\/b> monthly withdrawals.<\/p>","account.deposit.verification_button":"Get verified","trade_notification.title":"{amount} %amount_currency% %amount_action%, price {price} %price_currency%","trade_notification.body":"{sum} %sum_currency% %sum_action%","instruments.crypto":"Crypto","instruments.stable":"Stable","my_trades_body.price_title_prefix":"Total avg. price: ","my_trades_body.total_title_prefix":"Total sum: ","reports.summary.not_available":"Temporary unavailable","reports.table.not_available":"Temporary unavailable","passwords_do_not_match":"Passwords do not match","email_invalid":"Email address is invalid","password_empty":"Password cannot be empty","password_max_length":"Password should be maximum 255 characters","password_min_length":"Password should be minimum 6 characters","password_pattern":"At least 6 characters, including one number, one uppercase and one lowercase character","sub_accounts.transfer.from_error":"From email is invalid","sub_accounts.transfer.to_error":"To email is invalid","sub_accounts.transfer.amount_error":"Amount is invalid","sub_accounts.transfer.currency":"Currency is invalid","sub_accounts.transfer.cant_find_user":"Cant find user","sub_accounts.repeat_password":"Repeat password","account.deposit.unavaliableMessageFiat":"Fiat currency pay-ins cannot be made via this website. Please contact Bequant Sales at sales@bequant.io to request instructions for paying in fiat currency.","sub_accounts.select_account":"Select Account","sub_accounts.all_sub_accounts":"All","sub_accounts.select_loading":"Loading...","mail.withdrawal_confirmation":"Withdrawal confirmation","acc_in_danger.alert":"Dear Trader,\n\nDue to security reasons in order to protect your funds, we had to temporary restrict the functionality.\n\n<ol>\n  <li>Please set the <a href=\"https:\/\/hitbtc.com\/settings\/security\">2 factor authentica